<!DOCTYPE html>
<html>
  <head>
    <title>横竖屏</title>
    <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
    <meta http-equiv="content-type" content="text/html; charset=utf-8"/>
    <meta name="apple-mobile-web-app-capable" content="yes"/>
    <link href="resources/css/jquery-ui-themes.css" type="text/css" rel="stylesheet"/>
    <link href="resources/css/axure_rp_page.css" type="text/css" rel="stylesheet"/>
    <link href="data/styles.css" type="text/css" rel="stylesheet"/>

    <script src="resources/scripts/axure/events.js"></script>
    <script src="resources/scripts/axure/action.js"></script>
    <script src="resources/scripts/axure/expr.js"></script>
    <script src="resources/scripts/axure/geometry.js"></script>
    <script src="resources/scripts/axure/flyout.js"></script>
    <script src="resources/scripts/axure/ie.js"></script>
    <script src="resources/scripts/axure/model.js"></script>
    <script src="resources/scripts/axure/repeater.js"></script>
    <script src="resources/scripts/axure/sto.js"></script>
    <script src="resources/scripts/axure/utils.temp.js"></script>
    <script src="resources/scripts/axure/variables.js"></script>
    <script src="resources/scripts/axure/drag.js"></script>
    <script src="resources/scripts/axure/move.js"></script>

    <script src="resources/scripts/axure/tree.js"></script>

    <script src="resources/scripts/axure/legacy.js"></script>
    <script src="resources/scripts/axure/viewer.js"></script>
    <script type="text/javascript">
      $axure.utils.getTransparentGifPath = function() { return 'resources/images/transparent.gif'; };
      $axure.utils.getOtherPath = function() { return 'resources/Other.html'; };
      $axure.utils.getReloadPath = function() { return 'resources/reload.html'; };
    </script>
  </head>
  <body>
    <div id="base" class="">

      <!-- 横竖屏 (Dynamic Panel) -->
      <div id="u0" class="ax_dynamic_panel" data-label="横竖屏">
        <div id="u0_state0" class="panel_state" data-label="竖屏">
          <div id="u0_state0_content" class="panel_state_content">

            <!-- Unnamed (Image) -->
            <div id="u1" class="ax_image">
              <img id="u1_img" class="img " src="images/流程图/u0.png"/>
              <!-- Unnamed () -->
              <div id="u2" class="text">
                <p><span>&nbsp;</span></p>
              </div>
            </div>

            <!-- 竖 (Inline Frame) -->
            <iframe id="u3" data-label="竖" scrolling="no" frameborder="1"></iframe>
          </div>
        </div>
        <div id="u0_state1" class="panel_state" data-label="横屏">
          <div id="u0_state1_content" class="panel_state_content">

            <!-- Unnamed (Image) -->
            <div id="u4" class="ax_image">
              <img id="u4_img" class="img " src="images/趋势/u17.png"/>
              <!-- Unnamed () -->
              <div id="u5" class="text">
                <p><span>&nbsp;</span></p>
              </div>
            </div>

            <!-- 横 (Inline Frame) -->
            <iframe id="u6" data-label="横" scrolling="no" frameborder="1"></iframe>

            <!-- 今天-横屏 (Dynamic Panel) -->
            <div id="u7" class="ax_dynamic_panel" data-label="今天-横屏">
              <div id="u7_state0" class="panel_state" data-label="透明">
                <div id="u7_state0_content" class="panel_state_content">
                </div>
              </div>
              <div id="u7_state1" class="panel_state" data-label="事业部横屏">
                <div id="u7_state1_content" class="panel_state_content">

                  <!-- Unnamed (Inline Frame) -->
                  <iframe id="u8" scrolling="no" frameborder="1"></iframe>
                </div>
              </div>
              <div id="u7_state2" class="panel_state" data-label="专场横屏">
                <div id="u7_state2_content" class="panel_state_content">

                  <!-- Unnamed (Inline Frame) -->
                  <iframe id="u9" scrolling="no" frameborder="1"></iframe>
                </div>
              </div>
            </div>

            <!-- 历史-横屏 (Dynamic Panel) -->
            <div id="u10" class="ax_dynamic_panel" data-label="历史-横屏">
              <div id="u10_state0" class="panel_state" data-label="透明">
                <div id="u10_state0_content" class="panel_state_content">
                </div>
              </div>
              <div id="u10_state1" class="panel_state" data-label="事业部横屏">
                <div id="u10_state1_content" class="panel_state_content">

                  <!-- Unnamed (Inline Frame) -->
                  <iframe id="u11" scrolling="no" frameborder="1"></iframe>
                </div>
              </div>
              <div id="u10_state2" class="panel_state" data-label="专场横屏">
                <div id="u10_state2_content" class="panel_state_content">

                  <!-- Unnamed (Inline Frame) -->
                  <iframe id="u12" scrolling="no" frameborder="1"></iframe>
                </div>
              </div>
              <div id="u10_state3" class="panel_state" data-label="KPI横屏">
                <div id="u10_state3_content" class="panel_state_content">

                  <!-- Unnamed (Inline Frame) -->
                  <iframe id="u13" scrolling="no" frameborder="1"></iframe>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  </body>
</html>
